import React from 'react';
import PropTypes from 'prop-types';

const CuadroSoftware = ({ imagenSrc, alt, texto }) => {
    return (
        <div className="software-item">
            <div className="software-contenido">
            <img src={process.env.PUBLIC_URL + imagenSrc} alt={alt} className="software-imagen" loading="lazy" />
                 
            </div>
            <div className="texto">
                <p className="software-texto">{texto}</p>
            </div>

        </div>

    );
};

CuadroSoftware.propTypes = {
    imagenSrc: PropTypes.string.isRequired,
    alt: PropTypes.string.isRequired,
    texto: PropTypes.string.isRequired,
};

export default CuadroSoftware;
